def imper_func(realisation,x):
    k=0
    for elem in realisation:
        if elem<=x:
            k +=1

    return k/len(realisation)
samples0=np.linspace(start=0,stop=1,num=1000)
def sup(realisation1,realisation2):
    f1=[imper_func(realisation1,t) for t in samples0]
    f2=[imper_func(realisation2,t) for t in samples0]
    s=0
    for i in range(len(samples0)):
        s=max(s,abs(f1[i]-f2[i]))
    return s
def D(realisation1, realisation2):
    m=len(realisation1)
    n=len(realisation2)
    return round(np.sqrt(m*n/(m+n))*sup(realisation1,realisation2),4)
